import React from 'react';
import ComponentLearnLayout from '../../../../layouts/componentLearnLayout/ComponentLearnLayout';
import Header from '../../../../../commonComponents/header/Header';
/**
 * Description - This Function display the cables information
 * @returns - cable information
 */
function infoCABLES() {
  return (
    <ComponentLearnLayout name='cables'>
      <Header h1Heading='Cable Information' />
      <h2>What are the Internal PC Cables?</h2>
      <p>
        Once you have installed the motherboard and power supply, fitted in the
        CPU, and slotted your RAM modules, itâ€™s time to connect all the cables
        on the board. Internal connectors are located inside a computer case. PC
        internal cables make the core of a computer. There are basically two
        main types of connectors found in the computer internally: socket
        connectors and power connectors. Socket connectors are generally used to
        transfer data among devices. Power connectors, on the other hand, are
        responsible for supplying and distributing power to internal devices
        inside the computer.
      </p>
      <p></p>
      <p>
        Please pay attention, this component is not available for selection
        because this is a custom selected product
      </p>
    </ComponentLearnLayout>
  );
}

export default infoCABLES;
